(2, 'SƠMI VẠT ĐẮP MẢNH GHÉP CỔ ĐIỂN', '<p><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Hàng mới về đã nhanh chóng trở thành \"hot item\" trong lòng hội chị em. Thiết kế trên nền chất liệu Poplin (broadcloth) mềm mại, láng mịn, là loại vải chuyên dụng để may sơ mi cổ điển. Chiếc áo mang đến cho bạn những nét quyến rũ và sang trọng kết hợp phần vạt đắp chéo với khuy gài nhấn eo tinh tế, không lộ bụng nếu bạn có hơi dư \"bé mỡ\".</span><br style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Những quý cô yêu thích phong cách cổ điển thanh lịch và muốn che đi khuyết điểm của vòng eo thì đừng bỏ lỡ em sơmi vạt đắp của Hnoss nhé!</span><span class=\"pq6dq46d tbxw36s4 knj5qynh kvgmc6g5 ditlmg2l oygrvhab nvdbi5me sf5mxxl7 gl3lb2sf hhz5lgdu\" style=\"margin: 0px 1px; height: 16px; width: 16px; display: inline-flex; vertical-align: middle; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><br></span></p><p><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">- 3 tone màu cơ bản dễ phối đồ: Đen, trắng, xanh baby</span></p><p><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">-&nbsp;</span><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Đầy đủ 3 size: Màu đen &amp; trắng (S-M-L), xanh baby (M)</span></p><p><font color=\"#050505\" face=\"Segoe UI Historic, Segoe 