(13, 'GÓC KHOE \"CHIẾN LỢI PHẨM\" MÙA #BLACKFRIDAY', '<p><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Nghe đồn, hàng ngàn chị em đã rinh về túi cực đại , hãy khoe ngay thành tích săn sale của bạn. Hnoss sẽ chọn ngẫu nhiên 3 bạn để nhận quà ngay.</span></p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; list-style: outside none none; padding: 0px; color: rgb(35, 35, 35); font-family: &quot;Open Sans&quot;, sans-serif;\"><li><font color=\"#050505\" face=\"Segoe UI Historic, Segoe UI, Helvetica, Arial, sans-serif\"><span style=\"font-size: 15px;\"><span style=\"font-weight: bolder;\">Website: https://fesastorefpoly.com/</span></span></font></li><li><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><span style=\"font-weight: bolder;\">Shopping An Toàn - FREESHIP từ 199K</span></span></li></ul><p><br></p>', '\"Thả\" 1 chiếc hình thực tế nhận combo quà 1 triệu đồng', 'Blog/blackfriday2.png', '1', 'goc-khoe-chien-loi-pham-mua-blackfriday', 3, '2021-12-06 23:44:01', '2021-12-06 23:44:01'),
(14, 'HÀNG MỚI RA LÒ - SALE KHÔNG ĐẮN ĐO', '<p><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Chào mừng tuần lễ cuối năm, FESA chơi lớn, hàng mới lên kệ cũng sale luôn cho chị em phấn khởi mua sắm. Những mẫu thiết kế hiện đại, xu hướng mới nhất của năm rất đáng để các quý cô rinh ngay một em gia nhập tủ đồ của mình đấy ạ!</span></p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; list-style: outside none none; padding: 0px; color: rgb(35, 35, 35); font-family: &quot;Open Sans&quot;, sans-serif;\"><li><font color=\"#050505\" face=\"Segoe UI Historic, Segoe UI, Helvetica, Arial, sans-serif\"><span style=\"font-size: 15px;\"><span style=\"font-weight: bolder;\">Website: https://fesastorefpoly.com/</span></span></font></li><li><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><span style=\"font-weight: bolder;\">Shopping An Toàn - FREESHIP từ 199K</span></span></li></ul><p><br></p>', 'Mẫu mới về cũng SALE CỰC ĐẠI từ 99k', 'Blog/new3.png', '1', 'hang-moi-ra-lo-sale-khong-dan-do', 5, '2021-12-06 23:46:24', '2021-12-06 23:46:24'),
(15, 'HÀNG MỚI LÊN KỆ - HỐT LẸ', '<p><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Chắc hẳn chị em đang muốn đổi gió và refresh tủ đồ của mình thật lộng lẫy cho cuối năm. Thế thì không nên bỏ lỡ livestream lúc 19h30 tối nay.</span><br style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><br style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">Fesa Store sẽ ưu đãi cực sốc cho các chị em săn những SIÊU PHẨM MỚI thời thượng và sang trọng.</span></p><ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; list-style: outside none none; padding: 0px; color: rgb(35, 35, 35); font-family: &quot;Open Sans&quot;, sans-serif;\"><li><font color=\"#050505\" face=\"Segoe UI Historic, Segoe UI, Helvetica, Arial, sans-serif\"><span style=\"font-size: 15px;\"><span style=\"font-weight: bolder;\">Website: https://fesastorefpoly.com/</span></span></font></li><li><span style=\"color: rgb(5, 5, 5); font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><span style=\"font-weight: bolder;\">Shopping An Toàn - FREESHIP từ 199K</span></span></li></ul><p><br></p>', 'Xem trước hàng mới về đồng giá chỉ từ 99K', 'Blog/new4.png', '1', 'hang-moi-len-ke-hot-le', 5, '2021-12-06 23:48:34', '2021-12-06 23:48:34');

